window.bookSummaryJSON = "<p>Follow along as Ada Calhoun and Audible editor Courtney Reimer—both Gen X women living the chaos and joy Calhoun chronicles in her new work, <i>Why We Can’t Sleep</i> – go about their busy days to illustrate the universality of the modern midlife crisis. You’ll hear the many sounds of a life fully lived amid commuting, dining, parenting, and preparing for all the obstacles family and career might throw in the way.&nbsp;</p>"; 
